script: |
  super -f text -I q10348.spq | sort > q10348.out

inputs:
  - name: q10348.spq
    data: |
      SELECT DISTINCT - 91 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * - col0 NOT IN ( - + 29 * - + col1, - col1 - + - ( col1 ) );
  - name: tab1

outputs:
  - name: q10348.out
    data: |
      -91
